import React, { Component } from 'react';
import { AlexSun } from '../../images/index'

export class Home extends Component {
  render() {
    return (
      <div className="home">
        <h1>Hello from home</h1>
        <img src={AlexSun} alt="" />
      </div>
    )
  }
}

export default Home
